//adds geojson var called regions

var addgeoJSON_regions = L.geoJSON(regions, {
  style: function(feature) {
    return {
      color: "#0b03fc",
      weight: 2.0,
    }
//sets color and weight of features
  },
  onEachFeature: function(feature, layer) {
    if(feature.geometry.type==='MultiPolygon') {
    layer.bindPopup(feature.properties.rgn15nm);
    layer.on('mouseover', function (e) {
            this.openPopup();
        });
        layer.on('mouseout', function (e) {
            this.closePopup();
        });
  }
//links popups to all multipolygon features. Mouse over popups set to show the location rgn15nm property of the feature
}
}).addTo(map);
//adds regions geoJSON feature to map

var featureGroup_regions = L.featureGroup([addgeoJSON_regions]).addTo(map);
//creates feature group for the regions variable.

featureGroup_regions.on("click", function (event) {
    map.fitBounds(event.layer.getBounds());
    map.removeLayer(featureGroup_regions)
    map.addLayer(featureGroup_counties)
//when regions feature group is clicked, zooms to regions boundary, removes  regions layer and adds counties layer
});


